import React from 'react'
import '../App.css'
const Course = ({ course }) => {
    console.log(course)
    const sum = course.parts.reduce((sum, val) => sum + val, 0)
    return (
        <div>
            <ul>
                {course.parts.map((x, i) =>
                    <li className='list-item' key={x.id}>
                        {x.name} {x.exercises}
                    </li>)}
            </ul>
            <p>total of {sum}</p>
        </div>
    )
}

export default Course
